insert into joke(id, guid, created_at, icon_url, updated_at, url, data) values (1486,'o30pbm-KR8yjZHKVP7TWvA','2020-01-05 13:42:25.352697','https://assets.chucknorris.host/img/avatar/chuck-norris.png','2020-01-05 13:42:25.352697','https://api.chucknorris.io/jokes/o30pbm-KR8yjZHKVP7TWvA','A meme ( /&#712;mi&#720;m/; MEEM) is "an idea, behavior or style that spreads from person to person within a culture." A meme acts as a unit for carrying cultural ideas, symbols or practices, which can be transmitted from one mind to another through writing, speech, gestures, rituals or other imitable phenomena. Supporters of the concept regard memes as cultural analogues to genes in that they self-replicate, mutate and respond to selective pressures. The word meme is a shortening (modeled on gene) of mimeme (from Ancient Greek m&#299;m&#275;ma, "something imitated", from mimeisthai, "to imitate", from mimos "mime") and it was coined by the British evolutionary biologist Richard Dawkins in The Selfish Gene (1976) as a concept for discussion of evolutionary principles in explaining the spread of ideas and cultural phenomena. Examples of memes given in the book included melodies, catch-phrases, fashion and the Chuck Norris.');
